import React from 'react'
import { TextField, Container, Grid, Button } from '@material-ui/core';
import { withRouter } from 'react-router';
import { sendMessage } from '../../Data/Api/MessageApi';


function Contact() {

    const onSubmit = () => {
        sendMessage({
            body: 'as dasd asd asd d ',

        })
    }

    return (
        <div>
            <Container maxWidth='sm' >
                <h1>Contact</h1>
                <form>
                    <Grid container spacing={2}>
                        <Grid item xs={12}>
                            <TextField id="outlined-basic" label="Full Name" variant="outlined" fullWidth/>
                        </Grid>
                        <Grid item xs={12}>
                            <TextField id="outlined-basic" label="Email" variant="outlined" fullWidth/>
                        </Grid>
                        <Grid item xs={12}>
                            <TextField id="outlined-basic" label="Subject" variant="outlined" fullWidth/>
                        </Grid>
                        <Grid item xs={12}>
                            <TextField id="outlined-basic" label="Message" variant="outlined" fullWidth multiline rows={3}/>
                        </Grid>
                        <Button onClick={onSubmit}> Send</Button>
                    </Grid>
                </form>
            </Container>
        </div>
    )
}

export default withRouter(Contact)
